import React from 'react';
import {css} from 'emotion'
import Modal from 'react-responsive-modal';
import cabeca from '../cabeca.png'


function University() {
    return (
        <div>
            <img className={styles.head} src={cabeca} alt="Patricia's Face"/>
        </div>
    )
}
export default University;

const styles = {
    head: css `
        cursor: pointer;
    `
}
